const URL = `https://jsonplaceholder.typicode.com/`

export const getArticles = () => (dispatch) => {
  fetch(`${URL}/posts`)
       .then((response) => response.json())
       .then((result) => {
           console.log(result)
           dispatch({
               type: GET_ARTICLES,
               payload: result
           })
       })
       .catch((err) => console.error(err.message))
}
